import Head from 'next/head';
import Container from '../components/container';

const About = () => {
    return(
        <div>
            <Head>
                <title>Next.js - About</title>
            </Head>
            <Navigation />
            <div>
                { props.children }
            </div>
        </div>
    )
}

export default About
